def default_col_asset(asset, sym):
    if asset == 'stk':
        return asset + '-' + sym + '_c'
    elif asset == 'fut':
        return asset + '-' + sym + '_1615'
    elif asset == 'crp':
        return asset + '-' + sym + '_c'

def default_sym_title(asset, sym):
    if asset == 'fut':
        if sym == 'es':
            return 'S&P 500 Index'
        if sym == 'us':
          return 'US 30 Year Bond'

    return sym.upper()


